import styled, { css } from "styled-components";

export default css`
  .header-logo {
    color: #bbb;
  }
`;

export const StyledHeader = styled.header`{
  width: 100%;
  top: 0;
  background-color: ${({ theme }) => theme.v};
  box-shadow: rgba(0, 0, 0, 0.05) 0px 4px 8px 0px;
  position: fixed;
  min-height: 4.6rem;
  z-index: 101;
}`
